      {" "}
      <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
        <Typography variant="h6" component="div" sx={{ color: "white" }}>
          My Weather App
        </Typography>
        {/* <Button variant="contained" color="primary" href="#">
          About
        </Button> */}
      </Toolbar>
    </AppBar>
  );
}

export default Header;
